import React from 'react';

const Body = () => {
    const language = ['React', 'JavaScript', 'Java', 'Servlet', 'SQL'];
    return (
        <div>
            <h1>This is the Body component</h1>
            <ul>
                {language.map((lang, index) => (
                    <li key={index}>{lang}</li>
                ))}
            </ul>
        </div>
    );
};

export default Body;
